import React from 'react';
import {Route} from "react-router-dom";
import Home from './pages/Home';
import './App.css';
// import Home from "./pages/Home";

class App extends React.Component{
  constructor(props){
    super(props);
    this.state={
      menu:[
        {
          name:"home",
          path:'/home',
          text:'首页'
        }
      ]
    }
  }
  render(){
    return (
      <div className="app-box">
        <div className="app-main">
            <h2>后台管理系统</h2>
        </div>
        <Route path="/home" Component={Home}/>
      </div>
    )
  }
}


export default App;
